function getInputs()
{	
	var xmlHttp = null;
    xmlHttp = new XMLHttpRequest();
   	xmlHttp.open( "GET", "getInputs.snf", false);
    xmlHttp.send( null );
    var receive = xmlHttp.responseXML;
    return receive.documentElement.getElementsByTagName("name");
}

